import { Container, Row, Col, Tab, Nav } from "react-bootstrap";
import { ProjectCard } from "./projectCard";

import projImg1 from "../assets/img/project-img1.png";
import projImg2 from "../assets/img/project-img2.png";
import projImg3 from "../assets/img/project-img3.png";

import meter2 from "../assets/img/team/Nathan-Team22.png";
import meter1 from "../assets/img/team/Philippe-Team.png";
import meter3 from "../assets/img/team/Killian-Team.png";
import meter4 from "../assets/img/team/Maxime-Team.png";
import meter5 from "../assets/img/team/Isaak-Team.png";
import meter6 from "../assets/img/team/Clement-Team.png";
import meter7 from "../assets/img/team/Quentin-Team.png";

import Carousel from 'react-multi-carousel';
import React, { useState, useEffect } from 'react';


import TrackVisibility from 'react-on-screen';
import { Skills } from "./skills";

export const Projects = () => {




  const projects = [
    {
      title: "Business Startup",
      description: "Design & Development",
      imgUrl: projImg1,
    },
    {
      title: "Business Startup",
      description: "Design & Development",
      imgUrl: projImg2,
    },
    {
      title: "Business Startup",
      description: "Design & Development",
      imgUrl: projImg3,
    },
    {
      title: "Business Startup",
      description: "Design & Development",
      imgUrl: projImg1,
    },
    {
      title: "Business Startup",
      description: "Design & Development",
      imgUrl: projImg2,
    },
    {
      title: "Business Startup",
      description: "Design & Development",
      imgUrl: projImg3,
    },
  ];


  //////////////

  const [slideIndex, setSlideIndex] = useState(0);

  useEffect(() => {
    // componentDidMount logic
    // This will run once when the component mounts
    // You can initialize any data or perform any side effects here
    // For example, fetching data from an API
  }, []);

  useEffect(() => {
    // componentDidUpdate logic
    // This will run whenever the slideIndex state changes
    console.log("slide Index Next 2 -->", slideIndex);
  }, [slideIndex]); // Dependency array ensures useEffect runs when slideIndex changes

  const responsive = {
    superLargeDesktop: {
      // the naming can be any, depends on you.
      breakpoint: { max: 4000, min: 3000 },
      items: 5
    },
    desktop: {
      breakpoint: { max: 3000, min: 1024 },
      items: 3
    },
    tablet: {
      breakpoint: { max: 1024, min: 464 },
      items: 2
    },
    mobile: {
      breakpoint: { max: 464, min: 0 },
      items: 1
    }
  };


  useEffect(() => {
    console.log("slide Index Next 2 -->", slideIndex);
  }, [slideIndex]); // Dependency array ensures useEffect runs when slideIndex changes

  const handleNextClick = () => {
    if (slideIndex == 6) {
      setSlideIndex(0)
    } else {
      setSlideIndex(slideIndex + 1);
    }
  };

  const handlePrevClick = () => {

      if (slideIndex == 0) {
        setSlideIndex(6)
      } else {
        setSlideIndex(slideIndex - 1);
      }


  };

  const ButtonGroup = ({ next, previous, goToSlide, ...rest }) => {
    const { carouselState: { currentSlide } } = rest;

    const handlePreviousButtonClick = async () => {
      await previous();
      await handlePrevClick();
    };

    const handleNextButtonClick = async () => {
      await next();
      await handleNextClick();
    };

    return (
      <div className="carousel-button-group"> // remember to give it position:absolute
      <button className="react-multiple-carousel__arrow react-multiple-carousel__arrow--left" onClick={() => { 
          handlePreviousButtonClick();
      }}></button>

      <button className="react-multiple-carousel__arrow react-multiple-carousel__arrow--right" onClick={() => { next(); handleNextClick();}}></button>
      </div>
    );
  };


  const renderNameTeamWorker = (currentSlide) => {
    switch (currentSlide) {
      case 0:
        return "Nathan SABOURDY";
      case 1:
        return "Killian DESSERICH";
      case 2:
        return "Maxime ROTH-FESSLER";
      case 3:
        return "Isaak NICOLAS";
      case 4:
        return "Clément BERNAT";
      case 5:
        return "Quentin ROUVIER";
      case 6:
        return "Philippe CHEYPE";
    }
  };

  /////////////


  return (
    <section className="project" id="projects">
      <Container>
        <Row>
          <Col size={12}>
            <TrackVisibility>
              {({ isVisible }) =>
              <div className={isVisible ? "animate__animated animate__fadeIn": ""}>
                <h2>Projet</h2>
                <p style={{ color: 'white' }}>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.</p>
                <Tab.Container id="projects-tabs" defaultActiveKey="first">

                  <Nav variant="pills" className="nav-pills mb-5 justify-content-center align-items-center" id="pills-tab">
                    <Nav.Item>
                      <Nav.Link eventKey="first"><b>Web</b></Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                      <Nav.Link eventKey="second"><b>Mobile</b></Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                      <Nav.Link eventKey="third"><b>Matériel</b></Nav.Link>
                    </Nav.Item>
                  </Nav>

                  <Tab.Content id="slideInUp" className={isVisible ? "animate__animated animate__slideInUp" : ""}>
                    <Tab.Pane eventKey="first">
                      <Row>
                        {
                          projects.map((project, index) => {
                            return (
                              <ProjectCard
                                key={index}
                                {...project}
                                />
                            )
                          })
                        }
                      </Row>
                    </Tab.Pane>

                    <Tab.Pane eventKey="second">
                      <Row>

                        </Row>
                    </Tab.Pane>

                    <Tab.Pane eventKey="section">
                      <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Cumque quam, quod neque provident velit, rem explicabo excepturi id illo molestiae blanditiis, eligendi dicta officiis asperiores delectus quasi inventore debitis quo.</p>
                    </Tab.Pane>

                    <Tab.Pane eventKey="third">
                      <div className="container">
                        <div className="row">
                          <div className="col-12">
                            <div className="CarousselP-bx wow zoomIn">
                              <h2 style={{ color: "black" }}>Connexion</h2>
                              <p style={{ color: "black" }}>Lorem Ipsum is simply dummy text of the printing and typesetting industry.Lorem Ipsum has been the industry's standard dummy text. Nathan SABOURDY</p>
                            </div>
                          </div>
                        </div>
                      </div>
                    </Tab.Pane>

                  </Tab.Content>
                </Tab.Container>
              </div>}
            </TrackVisibility>
          </Col>
        </Row>
      </Container>

    </section>
  )
}
